import React from "react";
import classes from "../filter/filter.module.css";
import Lable from "./Lable";

const Filter = (props) => {
  return (
    <div className={classes.filter}>
      <p className={classes.title}>{props.title}</p>

      <div className={classes.filterChoice}>
        <Lable label="men" />
        <Lable label="women" />
        <label className={classes.container} htmlFor="women">
          <input type="checkbox" id="women"></input>
          <span className={classes.checkmark}></span>
          <span>women</span>
        </label>

        <label className={classes.container} htmlFor="kids">
          <input type="checkbox" id="kids"></input>
          <span className={classes.checkmark}></span>
          <span>kids</span>
        </label>
      </div>
    </div>
  );
};

export default Filter;
